import React, { Component } from 'react';

import "./NotFound.css";

class NotFound extends Component {

  render() {

    return (
      <div>
        <h1>404-Error has occurred!</h1>
        <p>Requested page could not be found.</p>
      </div>
    )
  }
}

export default NotFound;
